// import logo from './logo.svg';
import './styles/App.scss';
import logo from '../src/assets/DR Logo.png'
import Header from '../src/app/views/components/header';
import YTPlaylist from '../src/app/views/components/ytPlaylist';
import Terms from '../src/app/views/components/terms';

function App() {
  if (Date.parse('March 20 2021 00:00:00') - Date.parse(new Date() >= 0)){
    return

  }
  return (
    <div className="App">

      {(Date.parse('March 20 2021 00:00:00') - Date.parse(new Date() >= 0)) < 0 ?
        <div>
          {(Date.parse('March 20 2021 00:00:00') - Date.parse(new Date() >= 0)) < 0}
          <YTPlaylist />
          <Terms />
        </div>
      :
      <div>
          {(Date.parse('March 20 2021 00:00:00') - Date.parse(new Date() >= 0))}
        <Header />
      </div>
      }

    </div>
  );
}

export default App;
